import React from 'react';

function Introduction() {
  return (
    <div>
      <div className="container">
        <h1 className="text-center p-3">Self-Introduction</h1>
        <div className="row">
          <div className="col-sm-6">
              <h2>林湛</h2>
              <h4>前端工程師</h4>
              <h5></h5>
          </div>
          <div className="col-sm-6">345</div>
        </div>
      </div>
    </div>
  );
}

export default Introduction;
